    /**
     * Sunday 实现
     * @param haystack
     * @param needle
     * @return
     * @See https://leetcode-cn.com/problems/implement-strstr/solution/python3-sundayjie-fa-9996-by-tes/
     */
    public int strStrSunday(String haystack, String needle) {
        if("".equals(needle)) {
            return 0;
        }

        int hLen = haystack.length();
        int nLen = needle.length();
        if(hLen < nLen) {
            return -1;
        }

        char[] hChars = haystack.toCharArray();
        char[] nChars = needle.toCharArray();

        // 建立模式串偏移量字典
        Map<Character, Integer> shiftMap = new HashMap<>();
        for (int i = 0; i < nLen; i++) {
            int shift = nLen - i;
            if(null == shiftMap.get(nChars[i]) || shiftMap.get(nChars[i]) > shift) {
                shiftMap.put(nChars[i], shift);
            }
        }

        for (int idx = 0; idx < hLen - nLen + 1;) {
            if(hChars[idx] == nChars[0]) {
                // 开始匹配检查
                int j = 1;
                for (; j < nLen; j++) {
                    if(hChars[idx + j] != nChars[j]) {
                        break;
                    }
                }

                if(j >= nLen) {
                    return idx;
                } else {
                    // 不匹配，按模式串偏移量表偏移
                    int hNext = idx + nLen;
                    if(hNext >= hLen) {
                        // 已经匹配完
                        return -1;
                    }

                    idx += shiftMap.get(hChars[hNext]) == null ? nLen : shiftMap.get(hChars[hNext]);
                }
            } else {
                idx++;
            }
        }

        return -1;
    }

    @Test
    public void test() {
        Solution solution = new Solution();

        Assert.assertEquals(2, solution.strStr("hello", "ll"));

        Assert.assertEquals(-1, solution.strStr("aaaaa", "bba"));

        Assert.assertEquals(0, solution.strStr("", ""));

        Assert.assertEquals(-1, solution.strStr("aaa", "aaaa"));

        Assert.assertEquals(4, solution.strStr("mississippi", "issip"));

        Assert.assertEquals(39999, solution.strStr("", ""));

        Assert.assertEquals(2, solution.strStrKMP("hello", "ll"));

        Assert.assertEquals(-1, solution.strStrKMP("aaaaa", "bba"));

        Assert.assertEquals(0, solution.strStrKMP("", ""));

        Assert.assertEquals(-1, solution.strStrKMP("aaa", "aaaa"));

        Assert.assertEquals(4, solution.strStrKMP("mississippi", "issip"));

        Assert.assertEquals(39999, solution.strStrKMP("", ""));

        Assert.assertEquals(2, solution.strStrSunday("hello", "ll"));

        Assert.assertEquals(-1, solution.strStrSunday("aaaaa", "bba"));

        Assert.assertEquals(0, solution.strStrSunday("", ""));

        Assert.assertEquals(-1, solution.strStrSunday("aaa", "aaaa"));

        Assert.assertEquals(4, solution.strStrSunday("mississippi", "issip"));

        Assert.assertEquals(39999, solution.strStrSunday("", ""));

        System.out.println("ok");
    }
